import logo from './logo.svg';
import './App.css';
import Navber from './Navber';
import About from './About';
import Projects from './Projects';
import Signup from './Signup';
import Contact from './Contact';
import Footer from './Footer';

function App() {
  return (
    <>
    <Navber />
    <About />
    <Projects />
    <Signup />
    <Contact />
    <Footer />

    </>
  );
}



export default App;
